description:
The Hittites

History Documentary hosted by Jeremy Irons, published by Ekip Film in 2003 - English narration also known as
* Hittites


Information
------------------------------

This is the glorious story of the Hittites - the most powerful people in the Near East of their time. Narrated by Academy Award winner Jeremy Irons, &quot;The Hittites&quot; brings the fascinating history of this mighty empire to life with expert interviews, stunning cinematography, dramatic reenactments, and visual effects. Highlights include a breathtaking recreation of the controversial battle of Kadesh that decimated the armies of Egypt's Pharaoh Ramesses II. Based on the actual words of the Hittites, deciphered from ancient clay tablets excavated in the 20th century, their story unfolds as beautifully as it written almost 3500 years earlier.

